        const map = L.map('map').setView([41.58, -71.45], 10);
        L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
            attribution: '¬© OpenStreetMap, ¬© CARTO'
        }).addTo(map);
        
        // Normalize price to 0-1 scale based on actual distribution
        // Under 300K = 0.2, 300-500K = 0.4, 500-750K = 0.6, 750K-1M = 0.8, 1M+ = 1.0
        function priceToIntensity(price) {
            if (price < 300000) return 0.2;
            if (price < 500000) return 0.4;
            if (price < 750000) return 0.6;
            if (price < 1000000) return 0.8;
            return 1.0;
        }
        
        let currentData = P;
        let heatData = P.map(p => [p.a, p.b, priceToIntensity(p.c)]);
        let heat = L.heatLayer(heatData, { 
            radius: 20, 
            blur: 15, 
            maxZoom: 13,
            max: 1.0,
            gradient: {
                0.2: '#06b6d4',  // cyan - under 300K
                0.4: '#10b981',  // green - 300-500K
                0.6: '#f59e0b',  // amber - 500-750K
                0.8: '#ec4899',  // pink - 750K-1M
                1.0: '#7c3aed'   // purple - 1M+
            }
        }).addTo(map);
        
        // Color for markers
        function priceColor(price) {
            if (price < 300000) return '#06b6d4';
            if (price < 500000) return '#10b981';
            if (price < 750000) return '#f59e0b';
            if (price < 1000000) return '#ec4899';
            return '#7c3aed';
        }
        
        const markers = L.layerGroup();
        function buildMarkers(data) {
            markers.clearLayers();
            data.forEach(p => {
                const m = L.circleMarker([p.a, p.b], { 
                    radius: 5, 
                    fillColor: priceColor(p.c), 
                    color: '#fff', 
                    weight: 1, 
                    fillOpacity: 0.9 
                });
                m.bindPopup(`
                    <strong>${p.d}</strong><br>
                    ${p.e}, RI<br>
                    <strong style="color:${priceColor(p.c)}">$${p.c.toLocaleString()}</strong><br>
                    ${p.h} bed, ${p.i} bath<br>
                    ${p.f ? 'üåø Land' : 'üè† ' + (p.h > 0 ? 'Residential' : '')}<br>
                    ${p.g ? `<a href="${p.g}" target="_blank" style="color:#6366f1">View on Redfin ‚Üí</a>` : ''}
                `);
                markers.addLayer(m);
            });
        }
        buildMarkers(P);
        
        function toggle() { 
            document.getElementById('markers').checked ? map.addLayer(markers) : map.removeLayer(markers); 
        }
        
        function updateHeat() {
            map.removeLayer(heat);
            const r = parseInt(document.getElementById('radius').value);
            const b = parseInt(document.getElementById('blur').value);
            heat = L.heatLayer(heatData, { 
                radius: r, 
                blur: b, 
                maxZoom: 13,
                max: 1.0,
                gradient: {
                    0.2: '#06b6d4',
                    0.4: '#10b981',
                    0.6: '#f59e0b',
                    0.8: '#ec4899',
                    1.0: '#7c3aed'
                }
            }).addTo(map);
        }
        
        function filter() {
            const landOnly = document.getElementById('land').checked;
            currentData = landOnly ? P.filter(p => p.f) : P;
            heatData = currentData.map(p => [p.a, p.b, priceToIntensity(p.c)]);
            updateHeat();
            buildMarkers(currentData);
            if (document.getElementById('markers').checked) {
                map.removeLayer(markers);
                map.addLayer(markers);
            }
        }
    </script>
